import styles from "./Header.module.css";
const Header = () => {
  return (
    <div className={styles.header}>
      <span className={styles.TitleSm}>React & Node</span>
      <span className={styles.TitleLg}>Dohee's Blog</span>
    </div>
  );
};

export default Header;
